import React from 'react';

function Home({ featuredMixes, categories, recentMixes }) {
  return (
    <div className="home">
      <section className="featured">
        <h2>Featured Mixes</h2>
        <ul>
          {/* Map over the featured mixes and render them as a list */}
          {featuredMixes.map((mix) => (
            <li key={mix.key}>
              <img src={mix.pictures.large} alt={mix.name} />
              <h3>{mix.name}</h3>
              <p>{mix.user.name}</p>
            </li>
          ))}
        </ul>
      </section>
      <section className="categories">
        <h2>Categories</h2>
        <ul>
          {/* Map over the categories and render them as a list */}
          {categories.map((category) => (
            <li key={category.slug}>
              <img src={category.picture} alt={category.name} />
              <h3>{category.name}</h3>
            </li>
          ))}
        </ul>
      </section>
      <section className="recently-played">
        <h2>Recently Played Mixes</h2>
        <ul>
          {/* Map over the recently played mixes and render them as a list */}
          {recentMixes.map((mix) => (
            <li key={mix.key}>
              <img src={mix.pictures.large} alt={mix.name} />
              <h3>{mix.name}</h3>
              <p>{mix.user.name}</p>
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
}

export default Home;
